import React, {Component} from 'react'
import {StyledListItem, StyledList} from "./TodoList.styled";

const state = {
    done: false
};

class TodoList extends Component {

    onLabelClick = () => {
        this.setState(({done}) => {
            return {
                done: !done,
            }
        })
    };


    render() {
        let {data} = this.props;
        return (
            <div>
                <StyledList>
                    {data.map(({label, id}) => {
                        return (
                            <StyledListItem done={state.done} key={id} onClick={() => this.onLabelClick()}>
                                {label}
                            </StyledListItem>
                        )
                    })}

                </StyledList>
            </div>
        )
    }
}

export default TodoList;
